INSERT INTO `zene7_categories_description` (`categories_id`, `language_id`, `categories_name`, `categories_description`) VALUES
(1, 1, 'Television', '<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Spring isn&#39;t just known for warmer weather and great college ball, it&#39;s when the newest crop of HDTVs is released. Check out what&#39;s available now and research those HDTVs that will be arriving later this spring. Browse brands such as Panasonic, Samsung, Sony, Toshiba, and more.</span></span></span></p>'),
(2, 1, 'Camera', '<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">&nbsp;Capture life&#39;s most memorable moments to share with family and friends for years to come. Our wide selections of camera products make recording memories easy and fun</span></span></span></p>'),
(3, 1, 'Computers', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">The right computer can be the center of your digital home &mdash; everyday tasks and homework, plus photos, music, and games.</span></span></p>'),
(4, 1, 'Desktop', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Whether you need computer for </span></span><b><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Photos &amp; Music or Entertainment or Gaming, </span></span></b><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">we got it. Look no further. We offer computers with lots of </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">hard drive space for multimedia and everyday computing. Ample amount of memory to edit photos and videos. High-quality graphics with dedicated video memory to bring movies and games to life. Quad-core processing or better. Enhanced graphics and audio for eye-popping visuals and rich, full sound</span></span></p>'),
(5, 1, 'Laptop', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Powered by the latest ultra-low-voltage Intel processors, these cutting-edge laptops offer extended battery life at budget-friendly prices.</span></span></p>'),
(6, 1, 'Controllers', '<p>Welcome to the world of gaming that you take charge of every gaming console with the controller made specifically for it! Enjoy your gaming experience with the smooth feel of the controllers in your hands. Take control of the gaming world gamers!</p>'),
(7, 1, 'Test', ''),
(8, 1, 'Print document', ''),
(9, 1, 'Music CD', '');
INSERT INTO `zene7_configuration` (`configuration_id`, `configuration_title`, `configuration_key`, `configuration_value`, `configuration_description`, `configuration_group_id`, `sort_order`, `last_modified`, `date_added`, `use_function`, `set_function`, `val_function`) VALUES
(1, 'Store Name', 'STORE_NAME', 'Techninja', 'The name of my store', 1, 1, '2020-09-11 22:26:10', '2020-09-08 20:18:07', NULL, NULL, NULL),
(2, 'Store Owner', 'STORE_OWNER', 'Henry Allucard Hellsing', 'The name of my store owner', 1, 2, '2020-09-11 22:26:40', '2020-09-08 20:18:07', NULL, NULL, NULL),
(3, 'Telephone - Customer Service', 'STORE_TELEPHONE_CUSTSERVICE', '', 'Enter a telephone number for customers to reach your Customer Service department. This number may be sent as part of payment transaction details.', 1, 3, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(4, 'Country', 'STORE_COUNTRY', '223', 'The country my store is located in <br /><br /><strong>Note: Please remember to update the store zone.</strong>', 1, 6, NULL, '2020-09-08 20:18:07', 'zen_get_country_name', 'zen_cfg_pull_down_country_list(', NULL),
(5, 'Zone', 'STORE_ZONE', '18', 'The zone my store is located in', 1, 7, NULL, '2020-09-08 20:18:07', 'zen_cfg_get_zone_name', 'zen_cfg_pull_down_zone_list(', NULL),
(6, 'Expected Sort Order', 'EXPECTED_PRODUCTS_SORT', 'desc', 'This is the sort order used in the expected products box.', 1, 8, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'asc\', \'desc\'), ', NULL),
(7, 'Expected Sort Field', 'EXPECTED_PRODUCTS_FIELD', 'date_expected', 'The column to sort by in the expected products box.', 1, 9, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'products_name\', \'date_expected\'), ', NULL),
(8, 'Switch To Default Language Currency', 'USE_DEFAULT_LANGUAGE_CURRENCY', 'false', 'Automatically switch to the language\'s currency when it is changed', 1, 10, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(9, 'Language Selector', 'LANGUAGE_DEFAULT_SELECTOR', 'Default', 'Should the default language be based on the Store preferences, or the customer\'s browser settings?<br /><br />Default: Store\'s default settings', 1, 11, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Default\', \'Browser\'), ', NULL),
(10, 'Use Search-Engine Safe URLs (still in development)', 'SEARCH_ENGINE_FRIENDLY_URLS', 'false', 'Use search-engine safe urls for all site links', 6, 12, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(11, 'Display Cart After Adding Product', 'DISPLAY_CART', 'true', 'Display the shopping cart after adding a product (or return back to their origin)', 1, 14, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(12, 'Default Search Operator', 'ADVANCED_SEARCH_DEFAULT_OPERATOR', 'and', 'Default search operators', 1, 17, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'and\', \'or\'), ', NULL),
(13, 'Include meta-tags in product search?', 'ADVANCED_SEARCH_INCLUDE_METATAGS', 'true', 'Should a product\'s meta-tag keywords and meta-tag descriptions be considered in any <code>advanced_search_results</code> displayed?', 1, 18, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(14, 'Store Address and Phone', 'STORE_NAME_ADDRESS', 'Techninja\r\n250 Bedford park blvd\r\nBronx,New York, 10468\r\nUnited States\r\n800-643-9665', 'This is the Store Name, Address and Phone used on printable documents and displayed online', 1, 7, '2020-09-11 22:28:41', '2020-09-08 20:18:07', NULL, 'zen_cfg_textarea(', NULL),
(15, 'Show Category Counts', 'SHOW_COUNTS', 'true', 'Count recursively how many products are in each category', 1, 19, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(16, 'Tax Decimal Places', 'TAX_DECIMAL_PLACES', '0', 'Pad the tax value this amount of decimal places', 1, 20, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(17, 'Display Prices with Tax', 'DISPLAY_PRICE_WITH_TAX', 'false', 'Display prices with tax included (true) or add the tax at the end (false)', 1, 21, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(18, 'Display Prices with Tax in Admin', 'DISPLAY_PRICE_WITH_TAX_ADMIN', 'false', 'Display prices with tax included (true) or add the tax at the end (false) in Admin(Invoices)', 1, 21, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(19, 'Basis of Product Tax', 'STORE_PRODUCT_TAX_BASIS', 'Shipping', 'On what basis is Product Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone', 1, 21, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), ', NULL),
(20, 'Basis of Shipping Tax', 'STORE_SHIPPING_TAX_BASIS', 'Shipping', 'On what basis is Shipping Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone - Can be overridden by correctly written Shipping Module', 1, 21, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), ', NULL),
(21, 'Sales Tax Display Status', 'STORE_TAX_DISPLAY_STATUS', '0', 'Always show Sales Tax even when amount is $0.00?<br />0= Off<br />1= On', 1, 21, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'0\', \'1\'), ', NULL),
(22, 'Show Split Tax Lines', 'SHOW_SPLIT_TAX_CHECKOUT', 'false', 'If multiple tax rates apply, show each rate as a separate line at checkout', 1, 22, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(23, 'PA-DSS Admin Session Timeout Enforced?', 'PADSS_ADMIN_SESSION_TIMEOUT_ENFORCED', '1', 'PA-DSS Compliance requires that any Admin login sessions expire after 15 minutes of inactivity. <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>', 1, 30, '2020-09-08 20:18:07', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),', NULL),
(24, 'PA-DSS Strong Password Rules Enforced?', 'PADSS_PWD_EXPIRY_ENFORCED', '1', 'PA-DSS Compliance requires that admin passwords must be changed after 90 days and cannot re-use the last 4 passwords. <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>', 1, 30, '2020-09-08 20:18:07', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),', NULL),
(25, 'PA-DSS Ajax Checkout?', 'PADSS_AJAX_CHECKOUT', '1', 'PA-DSS Compliance requires that for some inbuilt payment methods, that we use ajax to draw the checkout confirmation screen. While this will only happen if one of those payment methods is actually present, some people may want the traditional checkout flow <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>', 1, 30, '2020-09-08 20:18:07', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),', NULL),
(26, 'Customer <em>Place Order</em>: Single Admin ID', 'EMP_LOGIN_ADMIN_ID', '0', 'Identify the ID number of an admin that is permitted to use the <em>Place Order</em> feature on the customers list, regardless of their assigned admin-profile. Set the value to 0 to disable the <em>Single Admin ID</em> feature.', 1, 300, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(27, 'Customer <em>Place Order</em>: Passwordless Login', 'EMP_LOGIN_AUTOMATIC', 'false', 'Login directly to store without entering credentials', 1, 302, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(28, 'Customer <em>Place Order</em>: Admin Profiles', 'EMP_LOGIN_ADMIN_PROFILE_ID', '0', 'Identify the admin <em>User Profile IDs</em> that are permitted to use the <em>Place Order</em> feature on the customers list &mdash; all admins that are in these profiles are permitted. Enter the value as a comma-separated list (intervening blanks are OK) of Admin Profile IDs, e.g. <b>1, 2, 3</b>. Set the value to 0 to disable the <em>Admin Profiles</em> feature.<br><br><b>Default: 0 </b>', 1, 301, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(29, 'Admin Session Time Out in Seconds', 'SESSION_TIMEOUT_ADMIN', '900', 'Enter the time in seconds.<br />Max allowed is 900 for PCI Compliance Reasons.<br /> Default=900<br />Example: 900= 15 min <br /><br />Note: Too few seconds can result in timeout issues when adding/editing products', 1, 40, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(30, 'Admin Set max_execution_time for processes', 'GLOBAL_SET_TIME_LIMIT', '60', 'Enter the time in seconds for how long the max_execution_time of processes should be. Default=60<br />Example: 60= 1 minute<br /><br />Note: Changing the time limit is only needed if you are having problems with the execution time of a process', 1, 42, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(31, 'Show if version update available', 'SHOW_VERSION_UPDATE_IN_HEADER', 'true', 'Automatically check to see if a new version of Zen Cart is available. Enabling this can sometimes slow down the loading of Admin pages. (Displayed on main Index page after login, and Server Info page.)', 1, 44, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(32, 'Store Status', 'STORE_STATUS', '0', 'What is your Store Status<br />0= Normal Store<br />1= Showcase no prices<br />2= Showcase with prices', 1, 25, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'0\', \'1\', \'2\'), ', NULL),
(33, 'Server Uptime', 'DISPLAY_SERVER_UPTIME', 'true', 'Displaying Server uptime can cause entries in error logs on some servers. (true = Display, false = don\'t display)', 1, 46, '2003-11-08 20:24:47', '0001-01-01 00:00:00', '', 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(34, 'Missing Page Check', 'MISSING_PAGE_CHECK', 'Page Not Found', 'Zen Cart can check for missing pages in the URL and redirect to Index page. For debugging you may want to turn this off. <br /><br /><strong>Default=On</strong><br />On = Send missing pages to \'index\'<br />Off = Don\'t check for missing pages<br />Page Not Found = display the Page-Not-Found page', 1, 48, '2003-11-08 20:24:47', '0001-01-01 00:00:00', '', 'zen_cfg_select_option(array(\'On\', \'Off\', \'Page Not Found\'),', NULL),
(35, 'cURL Proxy Status', 'CURL_PROXY_REQUIRED', 'False', 'Does your host require that you use a proxy for cURL communication?', 6, 50, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'True\', \'False\'), ', NULL),
(36, 'cURL Proxy Address', 'CURL_PROXY_SERVER_DETAILS', '', 'If you have a hosting service that requires use of a proxy to talk to external sites via cURL, enter their proxy address here.<br />format: address:port<br />ie: 127.0.0.1:3128', 6, 51, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(37, 'HTML Editor', 'HTML_EDITOR_PREFERENCE', 'NONE', 'Please select the HTML/Rich-Text editor you wish to use for composing Admin-related emails, newsletters, and product descriptions', 1, 110, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_pull_down_htmleditors(', NULL),
(38, 'Default for Notify Customer on Order Status Update?', 'NOTIFY_CUSTOMER_DEFAULT', '1', 'Set the default email behavior on status update to Send Email, Do Not Send Email, or Hide Update.', 1, 120, '2020-09-08 20:18:07', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_drop_down(array( array(\'id\'=>\'1\', \'text\'=>\'Email\'), array(\'id\'=>\'0\', \'text\'=>\'No Email\'), array(\'id\'=>\'-1\', \'text\'=>\'Hide\')),', NULL),
(39, 'Show Category Counts - Admin', 'SHOW_COUNTS_ADMIN', 'true', 'Show Category Counts in Admin?', 1, 19, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(40, 'Show linked status for categories', 'SHOW_CATEGORY_PRODUCTS_LINKED_STATUS', 'true', 'Show Category products linked status?', 1, 19, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(41, 'Currency Conversion Ratio', 'CURRENCY_UPLIFT_RATIO', '1.05', 'When auto-updating currencies, what \"uplift\" ratio should be used to calculate the exchange rate used by your store?<br />ie: the bank rate is obtained from the currency-exchange servers; how much extra do you want to charge in order to make up the difference between the bank rate and the consumer rate?<br /><br /><strong>Default: 1.05 </strong><br />This will cause the published bank rate to be multiplied by 1.05 to set the currency rates in your store.', 1, 55, NULL, '2020-09-08 20:18:07', NULL, NULL, NULL),
(42, 'Currency Exchange Rate: Primary Source', 'CURRENCY_SERVER_PRIMARY', 'ecb', 'Where to request external currency updates from (Primary source)<br><br>Additional sources can be installed via plugins.', 1, 55, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_pull_down_exchange_rate_sources(', NULL),
