(255, 'Show Notice of Combining Shopping Cart on Login', 'SHOW_SHOPPING_CART_COMBINED', '1', 'When a customer logs in and has a previously stored shopping cart, the products are combined with the existing shopping cart.<br /><br />Do you wish to display a Notice to the customer?<br /><br />0= OFF, do not display a notice<br />1= Yes show notice and go to shopping cart<br />2= Yes show notice, but do not go to shopping cart', 9, 35, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'0\', \'1\', \'2\'), ', NULL),
(256, 'Log Database Queries', 'STORE_DB_TRANSACTIONS', 'false', 'Record the database queries to files in the system /logs/ folder. USE WITH CAUTION. This can seriously degrade your site performance and blow out your disk space storage quotas.<br><strong>Enabling this makes your site NON-COMPLIANT with PCI DSS rules, thus invalidating any certification.</strong>', 10, 5, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(257, 'Report All Errors (Admin)?', 'REPORT_ALL_ERRORS_ADMIN', 'No', 'Do you want create debug-log files for <b>all</b> PHP errors, even warnings, that occur during your Zen Cart admin\'s processing?  If you want to log all PHP errors <b>except</b> duplicate-language definitions, choose <em>IgnoreDups</em>.', 10, 40, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\', \'IgnoreDups\'),', NULL),
(258, 'Report All Errors (Store)?', 'REPORT_ALL_ERRORS_STORE', 'No', 'Do you want create debug-log files for <b>all</b> PHP errors, even warnings, that occur during your Zen Cart store\'s processing?  If you want to log all PHP errors <b>except</b> duplicate-language definitions, choose <em>IgnoreDups</em>.<br /><br /><strong>Note:</strong> Choosing \'Yes\' is not suggested for a <em>live</em> store, since it will reduce performance significantly!', 10, 41, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\', \'IgnoreDups\'),', NULL),
(259, 'Report All Errors: Backtrace on Notice Errors?', 'REPORT_ALL_ERRORS_NOTICE_BACKTRACE', 'No', 'Include backtrace information on &quot;Notice&quot; errors?  These are usually isolated to the identified file and the backtrace information just fills the logs. Default (<b>No</b>).', 10, 42, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\'),', NULL),
(260, 'E-Mail Transport Method', 'EMAIL_TRANSPORT', 'smtpauth', 'Defines the method for sending mail.<br /><strong>PHP</strong> is the default, and uses built-in PHP wrappers for processing.<br />Servers running on Windows and MacOS should change this setting to <strong>SMTP</strong>.<br /><br /><strong>SMTPAUTH</strong> should only be used if your server requires SMTP authorization to send messages. You must also configure your SMTPAUTH settings in the appropriate fields in this admin section.<br /><br /><strong>sendmail</strong> is for linux/unix hosts using the sendmail program on the server<br /><strong>\"sendmail-f\"</strong> is only for servers which require the use of the -f parameter to send mail. This is a security setting often used to prevent spoofing. Will cause errors if your host mailserver is not configured to use it.<br /><br /><strong>Qmail</strong> is used for linux/unix hosts running Qmail as sendmail wrapper at /var/qmail/bin/sendmail.', 12, 1, '2020-09-11 22:45:31', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'PHP\', \'sendmail\', \'sendmail-f\', \'smtp\', \'smtpauth\', \'Qmail\'),', NULL),
(261, 'SMTP Email Account Mailbox', 'EMAIL_SMTPAUTH_MAILBOX', 'storeowner@cis346.webdesignersworld.info', 'Enter the mailbox account name (me@mydomain.com) supplied by your host. This is the account name that your host requires for SMTP authentication.<br />Only required if using SMTP Authentication for email.', 12, 101, '2020-09-11 23:20:22', '2020-09-08 20:18:07', NULL, NULL, NULL),
(262, 'SMTP Email Account Password', 'EMAIL_SMTPAUTH_PASSWORD', 'lehman123456', 'Enter the password for your SMTP mailbox. <br />Only required if using SMTP Authentication for email.', 12, 101, '2020-09-11 22:47:00', '2020-09-08 20:18:07', 'zen_cfg_password_display', NULL, NULL),
(263, 'SMTP Email Mail Host', 'EMAIL_SMTPAUTH_MAIL_SERVER', 'p3plcpnl0914.prod.phx3.secureserver.net', 'Enter the DNS name of your SMTP mail server.<br />ie: mail.mydomain.com<br />or 55.66.77.88<br />Only required if using SMTP Authentication for email.', 12, 101, '2020-09-11 22:55:21', '2020-09-08 20:18:07', NULL, NULL, NULL),
(264, 'SMTP Email Mail Server Port', 'EMAIL_SMTPAUTH_MAIL_SERVER_PORT', '465', 'Enter the IP port number that your SMTP mailserver operates on.<br />Only required if using SMTP Authentication for email.<br><br>Default: 25<br>Typical values are:<br>25 - normal unencrypted SMTP<br>587 - encrypted SMTP<br>465 - older MS SMTP port', 12, 101, '2020-09-11 22:55:58', '2020-09-08 20:18:07', NULL, NULL, NULL),
(265, 'Send E-Mails', 'SEND_EMAILS', 'true', 'Send out e-mails?<br>Normally this is set to true.<br>Set to false to suppress ALL outgoing email messages from this store, such as when working with a test copy of your store offline.', 12, 1, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(266, 'E-Mail Linefeeds', 'EMAIL_LINEFEED', 'LF', 'Defines the character sequence used to separate mail headers.', 12, 2, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'LF\', \'CRLF\'),', NULL),
(267, 'Enable HTML Emails?', 'EMAIL_USE_HTML', 'true', 'Send emails in HTML format if recipient has enabled it in their preferences.', 12, 3, '2020-09-11 23:11:17', '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(268, 'Verify E-Mail Addresses Through DNS', 'ENTRY_EMAIL_ADDRESS_CHECK', 'false', 'Verify e-mail address through a DNS server', 6, 6, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(269, 'Email Archiving Active?', 'EMAIL_ARCHIVE', 'false', 'If you wish to have email messages archived/stored when sent, set this to \"true\".', 12, 6, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(270, 'E-Mail Friendly-Errors', 'EMAIL_FRIENDLY_ERRORS', 'true', 'Do you want to display friendly errors if emails fail?  Setting this to false will display PHP errors and likely cause the script to fail. Only set to false while troubleshooting, and true for a live shop.', 12, 7, NULL, '2020-09-08 20:18:07', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(271, 'Email Address (Displayed to Contact you)', 'STORE_OWNER_EMAIL_ADDRESS', 'adusei.henry12@gmail.com', 'Email address of Store Owner.  Used as \"display only\" when informing customers of how to contact you.', 12, 10, NULL, '2020-09-08 20:18:07', NULL, NULL, '{\"error\":\"TEXT_EMAIL_ADDRESS_VALIDATE\",\"id\":\"FILTER_CALLBACK\",\"options\":{\"options\":[\"configurationValidation\",\"sanitizeEmail\"]}}'),
(272, 'Email Address (sent FROM)', 'EMAIL_FROM', 'storeowner@cis346.webdesignersworld.info', 'Address from which email messages will be \"sent\" by default. Can be over-ridden at compose-time in admin modules.', 12, 11, '2020-09-11 22:59:43', '2020-09-08 20:18:07', NULL, NULL, '{\"error\":\"TEXT_EMAIL_ADDRESS_VALIDATE\",\"id\":\"FILTER_CALLBACK\",\"options\":{\"options\":[\"configurationValidation\",\"sanitizeEmail\"]}}'),
(273, 'Emails must send from known domain?', 'EMAIL_SEND_MUST_BE_STORE', 'Yes', 'Does your mailserver require that all outgoing emails have their \"from\" address match a known domain that exists on your webserver?<br /><br />This is often required in order to prevent spoofing and spam broadcasts.  If set to Yes, this will cause the email address (sent FROM) to be used as the \"from\" address on all outgoing mail.', 12, 11, NULL, '0001-01-01 00:00:00', NULL, 'zen_cfg_select_option(array(\'No\', \'Yes\'), ', NULL),
(274, 'Email Admin Format?', 'ADMIN_EXTRA_EMAIL_FORMAT', 'HTML', 'Please select the Admin extra email format (Note: Enable HTML Emails must be on for HTML option to work)', 12, 12, '2020-09-11 23:11:50', '0001-01-01 00:00:00', NULL, 'zen_cfg_select_option(array(\'TEXT\', \'HTML\'), ', NULL),
