INSERT INTO `zene7_products_description` (`products_id`, `language_id`, `products_name`, `products_description`, `products_url`, `products_viewed`) VALUES
(1, 1, 'Samsung UN55B8000 55-Inch 1080p 240Hz LED HDTV', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\">&nbsp;</span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Redefining the standards for viewing quality, energy-efficiency and home entertainment decor, the Samsung 8000 Series LED HDTVs deliver unparalleled picture quality and enhanced connectivity while also helping you reduce your carbon footprint with the reduced power consumption of the LED screen. Using Light Emitting Diodes (LEDs) as its primary light source--rather than traditional Cold Cathode Fluorescent Lamps (CCFL)--this cutting edge HDTV also offers the benefits of an ultra-high contrast ratio and a slim depth that allows for a more artful design. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">To battle motion blur and image judder that can plague LCD displays when displaying fast movement onscreen, this 8000 Series LED HDTV utilizes Samsung&#39;s Auto Motion Plus frame interpolation technology with an ulatra-fast 240Hz refresh rate--four times that of other TVs. It also boasts high dynamic contrast ratios, complements of the ground breaking LED light source.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">The 8000 Series features Samsung&#39;s new Internet@TV online content service. Developed with Yahoo!, Internet@TV uses either a wired or wireless Ethernet connection to access content onscreen from Yahoo!, Flickr, YouTube and more with the push of a button. The widget-based interface and scrollbar run along the bottom of the screen for easy browsing of the latest programs and content. And this HDTV is accented by Samsung&#39;s TOC (Touch of Color), which offers a hint of a translucent color around the edges of the unit for a uniquely fashionable look.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-size:18.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Key Features</span></span></span></b></span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Screen Size:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> 55 inches and&nbsp; Full 1080p HD </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Breakthrough LED picture quality</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> with true-to-life brightness ranging from the purest black to pristine white. </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Ultra-slim Design:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> 1.2-inch depth </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Ultra-quick 2ms response time</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> minimizes blurring of fast motion in sports programs. </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">HD-Grade Pixel Resolution:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> High-resolution pixel density is combined with a built-in image scaler to handle inputs from a variety of digital and analog audio/video sources. </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Auto Motion Plus 240Hz:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> Advanced processing that reduces blur and enhances image detail when viewing fast motion video sequences. </span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Ultra Clear Panel:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> Advanced LCD technology lets you enjoy crisp image details, natural skin tones, excellent shadow detail, and vibrant colors.</span></span></span></span></span></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(2, 1, 'Samsung LN32B460 32-Inch 720p LCD HDTV', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\">&nbsp;<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">This 32-inch LCD HDTV sports a 50,000:1 dynamic contrast ratio that creates breathtaking images while a fast 6ms response time contributes to smoother-motion action scenes. It also features our classic black bezel with a new twist--the bottom bezel and neck are transparent, creating a more modern look. Wondering which LCD HDTV is perfect for your home? The answer is crystal clear. The LN32B460 has all the features you need in a size that fits every space. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">50,000:1 dynamic contrast ratio</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Contrast and brightness levels achieve new heights in this LCD TV. Watch movies and shows come to life with enhanced details in very dark or bright scenes. Enjoy a more realistic, sharper picture quality that&#39;s sure to catch your eye.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Built-In Digital Tuner</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">All Samsung LCD HDTVs have an integrated digital tuner. So, whether you&#39;re watching over-the-air HD digital broadcasts or connecting to cable/satellite service, Samsung has got you covered.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">6ms Response</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">One of the most important features for an LCD panel is the pixel response time. Response time refers to the amount of time it takes a pixel to &quot;refresh&quot; itself-to go from being active to being inactive, (ready to be re-activated). The lower the milliseconds, the faster the response time. A very fast 6ms response time virtually eliminates any blurring and gives you smooth-motion action scenes.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">SRS TruSurround HD</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Assisted by the LN32B460&#39;s two 10W bottom speakers, this creates an immersive, feature-rich surround sound experience from two speakers, complete with rich bass, high-frequency detail and clear dialog.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">What&#39;s in the Box</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Samsung LN32B460 32-Inch 720p LCD HDTV, Remote control, TV stand, Cover bottom, Hardware, Owner&#39;s instructions, Warranty card, Safety guide manual, Cleaning cloth</span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(3, 1, 'LG 32LH30 32-Inch 1080p LCD HDTV, Gloss Black', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\">&nbsp;</span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Innovative Technologies</span></span></b></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Think there&rsquo;s no such thing as an affordable 1080p TV with great features and technology?&nbsp; You&rsquo;ll think again when you take a look at the LH30.&nbsp; It delivers a stunning picture in Full HD 1080p and LG&rsquo;s innovative Core Technologies deliver an enhanced audio and video experience.&nbsp; With the LH30, affordability doesn&rsquo;t mean compromise. It means getting a great HDTV&mdash;period. See for yourself.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Double the Detail</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Make all your favorite sports, TV shows, movies, and video games more realistic.&nbsp; Get nearly double the pixel resolution of standard HD with Full HD 1080p Resolution. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Like Night and Day</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">It&rsquo;s easy for details to get lost in the shadows.&nbsp; 50,000:1 Contrast Ratio allows for deeper blacks and greater picture detail, especially in darker scenes. </span></span></span></span></p>\r\n\r\n			<p style=\"margin-top:8px\"><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Audio Should be Heard, Not Seen</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">The slim-silhouette Invisible Speaker System<b> </b>delivers a look and audio that are equal parts clean and polished. </span></span></span></span></p>\r\n\r\n			<p style=\"margin-top:8px\"><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Hear Every Whisper</span></span></b><br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Get audio the way it was meant to be heard.&nbsp; Clear Voice II enhances and amplifies the frequency range of the human voice to help keep dialogue audible when background noise swells. </span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(4, 1, 'Panasonic VIERA S1 Series TC-L37S1 37-Inch 1080p LCD HDTV', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">&nbsp;<b>Key Features</b></span></span></span></span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">37&quot; LCD 1080p HDTV with Motion Focus Technology for improved resolution during fast action</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">IPS Alpha Panel delivers a 178-degree viewing angle with bright, clear images when viewed from most any location in the room</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">VIERA Image Viewer lets you share your digital photos with friends and family directly from SD cards</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">VIERA Link lets you control your compatible Panasonic DVD recorder, Blu-ray Disc player, home theater sound system, and HD camcorder with one remote</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Contrast ratio 15,000:1,ISP Alpha Panel with 178 degree viewing angle, Motion Focus Technology </span></span></span></span></span></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(5, 1, 'Canon PowerShot SX20IS 12.1MP Digital Camera with 20x Wide Angle', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\">&nbsp;</span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Discover the HD difference. With the classically stylish PowerShot SX20 IS, you can produce magnificent HD movies and dazzling photos. Loaded with features, it&rsquo;s got a high-powered 20x wide-angle optical zoom with Optical Image Stabilizer, 12.1 megapixels, a big 2.5-inch Vari-Angle LCD, Blink Detection and more.<br />\r\n			<br />\r\n			The PowerShot SX20 IS is equipped with many of the same features as a higher-end camera: an ultra-powerful zoom, eye-popping resolution and advanced picture-improving technology. 12.1 megapixels of resolution gives your photography incomparable depth and ensures that any section of any shot can be enlarged and cropped with no loss in quality when you edit the image even if you choose to print the image. It can create crisp, clear 13 x 19-inch posters.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Main Features</span></span></b> </span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">High-powered 20x wide-angle optical zoom with Optical Image Stabilizer</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Capture 720p HD movies with stereo sound; HDMI output connector for easy playback on your HDTV</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">2.5-inch Vari-Angle System LCD; improved Smart AUTO intelligently selects from 22 predefined shooting situations</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">DIGIC 4 Image Processor; 12.1-megapixel resolution for poster-size, photo-quality prints</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Powered by AA batteries (included); capture images to SD/SDHC memory cards (not included)</span></span></span></span></span></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(6, 1, 'Canon PowerShot G11 10MP Digital Camera with 5x Wide Angle Optic', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p>&nbsp;</p>\r\n\r\n			<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n				<tbody>\r\n					<tr>\r\n						<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n						<p><br />\r\n						<span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">The G Series comes full circle. You asked, and Canon not only listened, but delivered big-time. Advanced amateurs who have overwhelmingly embraced the G Series will be delighted with PowerShot G11, which features RAW mode for unlimited editing options, a 28mm wide-angle lens, and a 2.8-inch Vari-Angle PureColor System LCD. Add to that Canon&rsquo;s new High Sensitivity System and high-speed ISO for incredible image quality, and Canon&rsquo;s top-range compact digital camera is a truly groundbreaking successor.</span></span></span></span></p>\r\n\r\n						<p>&nbsp;</p>\r\n\r\n						<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Main Features</span></span></b> </span></span></p>\r\n\r\n						<ul>\r\n							<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">New 10-megapixel High Sensitivity System; DIGIC 4 Image Processor</span></span></span></span></span></li>\r\n							<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Bright 2.8-inch Vari-Angle PureColor System LCD plus optical viewfinder</span></span></span></span></span></li>\r\n							<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Wide-angle 5x optical zoom (equivalent to 28-140mm); Canon&#39;s Optical Image Stabilizer</span></span></span></span></span></li>\r\n							<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Improved Smart AUTO intelligently selects from 22 predefined shooting situations</span></span></span></span></span></li>\r\n							<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">RAW + JPEG shooting and recording modes; capture images to SD/SDHC memory cards (not included)</span></span></span></span></span></li>\r\n						</ul>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(7, 1, 'Panasonic Lumix DMC-ZS3 10MP Digital Camera with 12x Wide Angle', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\">&nbsp;<br />\r\n			<span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">The new Lumix ZS3 features 10.1-megapixels, a 25mm ultra-wide-angle lens and 12x optical zoom, meaning it has added 2x optical zoom to the award-winning TZ-series camera, yet reduced its size. The ZS3 also features a Leica DC Vario-Elmar lens and High Definition (HD) video recording ability, known as AVCHD Lite.<br />\r\n			<br />\r\n			The ZS3 is the world&rsquo;s first digital camera to feature HD video recording in &quot;AVCHD Lite.&quot; Compared with the conventional Motion JPEG format, AVCHD Lite allows longer recordings with breathtaking HD visual and audio quality. This combined with a well-considered control interface, which includes a dedicated movie recording button on the camera&rsquo;s back panel, makes the ZS3 a hybrid model that performs admirably for both still and motion image capture.</span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Main Features</span></span></b> </span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">10.1-megapixel resolution captures enough detail for poster-size prints</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">12x MEGA optical image-stabilized zoom; 25mm ultra-wide-angle lens</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Capture HD video in &quot;AVCHD Lite&quot; format</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Intelligent Auto (iA) mode; Face Recognition feature</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Capture images to SD/SDHC memory cards (not included)</span></span></span></span></span></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(8, 1, 'Apple iMac MB417LL/A 20-Inch Desktop', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Speedier than ever with the latest In<span style=\"color:black\">tel dual-core processor, the Apple iMac all-in-one desktop PC packs a complete, high-performance computer into its all-in-one design, sporting a sleek, professional aluminum enclosure that&#39;s joined precisely to a 20-inch glass cover to create a virtually seamless front surface. It&#39;s powered by a 2.66 GHz Intel Core 2 Duo processor, which includes an amazingly fast 1066 MHz front-side bus speed and super-sized 6 MB L2 cache. This dual-core processor also provides an optimized, multithreaded architecture for improved multitasking, video, and gaming performance. And this iMac also gets a boost in video processing power from the NVIDIA GeForce 9400M integrated graphics chip with 256 MB of DDR3 SDRAM shared with main memory. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">The iMac also features an ultra-thin aluminum Apple Keyboard--with dedicated keys for Mac features such as brightness, volume, eject, play/pause, and Expos&eacute;--as well as the wired Mighty Mouse. It&#39;s pre-loaded with Apple&#39;s Mac OS X 10.5 Leopard operating system, which enables easy backup of your most important data via Time Machine, a redesigned desktop that helps eliminate clutter. It also comes with the iLife &#39;09 suite of applications--including iPhoto, iMovie, Garageband, and iTunes--and the newest version of the fast-loading Safari web browser. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Hardware features include a 320 GB hard drive, 2 GB of RAM (with an 8 GB maximum capacity), 8x SuperDrive for burning movies to DVD, and music mixes to CD, integrated 802.11n wireless LAN, Gigabit Ethernet wired networking&nbsp;and Bluetooth 2.1+EDR connectivity. </span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(9, 1, 'Compaq Presario CQ5110F Desktop PC', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><br />\r\n			<span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Want to get back to the basics? Buy an easy-to-use, affordable Compaq Presario PC. Connect to your wired home or office network to surf the Web, email, and share files. Play and burn CDs and DVDs, plus create do<span style=\"color:black\">cuments, spreadsheets, and presentations.</span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Get exactly the computing performance you need for home, school, and your essential computing needs. The Compaq Presario CQ5110F comes with the power and memory to handle a variety of tasks, efficiently and reliably. The Compaq Presario CQ5110F, with its stylish design, is backed by Compaq&iquest;s award winning support and services. What&#39;s in the box: Presario cq510f desktop PC, Compaq USB keyboard, Compaq USB optical mouse, power cord, Cyberlink DVD Suite Deluxe software, muvee Reveal Basic, Microsoft Works 9, Adobe Reader 8, and Norton Internet Security 2009 with 60 days of complimentary live updates.</span></span></span></span><br />\r\n			&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">&nbsp;<b>SPECIFICATIONS:</b></span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Processor:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> 2.50GHz AMD Athlon<sup>&trade;</sup> X2 7550 Dual-Core Processor </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Operating System:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> Genuine Windows Vista<sup>&reg;</sup> Home Premium </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Hard Drive:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> 320 GB </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Memory (RAM): &nbsp;</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">3 G </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">DISC DRIVE: </span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">SuperMulti DVD Burner with LightScribe Technology </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Graphics Card:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> NVIDIA GeForce 6150 SE Graphics with 128MB integrated shared graphics memory. Up to 1343MB Total Available Graphics Memory as allocated by Windows Vista<sup>&reg;</sup> </span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">NETWORKING:</span></span></b><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\"> wired LAN</span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(11, 1, 'Apple MacBook Pro MB991LL/A 13.3-Inch Laptop', '<table class=\"Table\" style=\"width:732px; border-collapse:collapse; border:none\" width=\"732\">\r\n	<tbody>\r\n		<tr>\r\n			<td nowrap=\"nowrap\" style=\"border-bottom:1px solid #4bacc6; width:437px; padding:0in 7px 0in 7px; height:20px; background-color:#d2eaf1; border-top:1px solid #4bacc6; border-right:1px solid #4bacc6; border-left:1px solid #4bacc6\" valign=\"top\">\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Featuring a precision unibody enclosure crafted from a single block of aluminum, the MacBook Pro is thinner and li<span style=\"color:black\">ghter than its predecessor as well as stronger and more durable. But Apple didn&#39;t stop innovating with the body&#39;s design. The MacBook Pro also includes a new 13-inch, LED-backlit glass display (instead of an LCD panel) as well as a glass trackpad that doesn&#39;t include a button (for larger tracking area) that features Apple&#39;s Multi-Touch technology. </span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">This 13-inch MacBook Pro (model MB991LL/A) also now includes Apple&#39;s innovative built-in notebook battery for up to 7 hours of wireless productivity on a single charge without adding thickness, weight or cost. Using Adaptive Charging and advanced chemistry first introduced with the 17-inch MacBook Pro the built-in battery delivers up to 1000 recharges before it reaches 80 percent of its original capacity--nearly three times the lifespan of conventional batteries.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Under the hood, the MacBook Pro is powered by a powerful 2.53 GHz Intel Core 2 Duo processor (with 3 MB L2 cache and 1066 MHz front-side bus), which runs applications faster and more efficiently as well as helps to reduce power requirements and save on battery life. And video is powered by the NVIDIA GeForce 9400M integrated graphics processor, which provides an outstanding everyday graphics experience with up to a 5x performance boost.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">It comes pre-loaded with Apple&#39;s Mac OS X 10.5 Leopard operating system, and is ready to run the Mac OS X 10.6 Snow Leopard operating system. It also comes with the iLife &#39;09 suite of applications, including iPhoto, iMovie, Garageband, and iTunes.</span></span></span></span></p>\r\n\r\n			<p><span style=\"font-size:12pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">&nbsp;<b>Main Features</b></span></span> </span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list 17.25pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">2.53 GHz Core 2 Duo Processor</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list 17.25pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">4 GB DDR3 RAM</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list 17.25pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">250 GB hard drive, DVD/CD SuperDrive</span></span></span></span></span></li>\r\n				<li><span style=\"font-size:12pt\"><span style=\"tab-stops:list 17.25pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">Mac OS X 10.5 Leopard Operating System</span></span></span></span></span></li>\r\n				<li style=\"margin-left:7px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:list 17.25pt\"><span style=\"font-family:Times,serif\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"><span style=\"color:black\">NVIDIA GeForce 9400M Graphics, 13.3 inch LED Display</span></span></span></span></span></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(12, 1, 'DualShock 4', '<p>The DualShock 4 displays the same general layout and buttons as past DualShock controllers, but now the controller offers additional features along with new buttons. The most obvious change is the inclusion of a wide touchpad where the Select and Start button were; those buttons are now replaced with an Options button instead. Sony has mentioned that the touchpad can respond to up to two fingers at a time, which expands the number of possibilities for input to those like you would see on a smartphone.</p>\r\n\r\n<p>In addition, the DualShock 4 sports a 3.5-mm headphone jack that supports surround sound along with both an accelerometer and a gyroscope, both reported to be better than what is currently included in the DualShock 3 and&nbsp;<a href=\"https://www.ps4playstation4.com/ps4-remote-play-and-ps-vita-integration\">Vita</a>. The two rumble motors now have varying strength, a change from the DualShock 3 where rumble was either active or not.</p>', '', 0),
(13, 1, 'Microsoft Xbox One Black Wireless Controller', '<p>The best controller just got even better.</p>\r\n\r\n<p>Experience the enhanced comfort and feel of the new Xbox Wireless Controller, featuring a sleek, streamlined design and textured grip. Enjoy custom button mapping and up to twice the wireless range.</p>\r\n\r\n<p>*Button mapping available via Xbox Accessories app for Xbox One and Windows 10. Range compared to previous controllers, using the Xbox One S console. Operating system updates may be required. Go to xbox.com/xboxone/controller-OS for more information.</p>\r\n\r\n<ul>\r\n	<li>Experience the enhanced comfort and feel of the new Xbox Wireless Controller</li>\r\n	<li>Get up to twice the wireless range than previous controllers</li>\r\n	<li>Stay on target with textured grip</li>\r\n	<li>Includes Bluetooth&reg; technology for gaming on Windows 10 PCs and tablets</li>\r\n</ul>\r\n\r\n<p>* Range compared to previous controllers, using the Xbox One S console. Operating system updates may be required. Go to xbox.com/xboxone/controller-OS for more information.</p>', '', 0),
(14, 1, 'Nintendo Switch Joy-Con (L)/(R) Neon Purple/Orange', '<p>The&nbsp;<b>Joy-Con Controllers</b>&nbsp;are the primary controllers for the&nbsp;<a href=\"https://nintendo.fandom.com/wiki/Nintendo_Switch\" title=\"Nintendo Switch\">Nintendo Switch</a>. With separate left and right variations, the controllers attach either to the sides of the Switch&#39;s screen or to the&nbsp;<a data-uncrawlable-url=\"L3dpa2kvSm95LUNvbl9HcmlwP2FjdGlvbj1lZGl0JnJlZGxpbms9MQ==\" rel=\"nofollow\" title=\"Joy-Con Grip (page does not exist)\">Joy-Con Grip</a>. They each feature Wii/Wii U Remote-esque gyro/motion controls,&nbsp;<a data-uncrawlable-url=\"L3dpa2kvSERfUnVtYmxlP2FjdGlvbj1lZGl0JnJlZGxpbms9MQ==\" rel=\"nofollow\" title=\"HD Rumble (page does not exist)\">HD Rumble</a>, and an NFC reader&nbsp;<a href=\"https://nintendo.fandom.com/wiki/Amiibo\" title=\"Amiibo\">amiibo</a>&nbsp;support.</p>\r\n\r\n<nav data-loaded=\"false\" id=\"toc\">&nbsp;</nav>', '', 0),
(15, 1, 'PowerA - Controller for Nintendo Switch - Matte Black', '<p>Challenge your friends to an exciting match with this black Power A controller for the Nintendo Switch. The stylish ergonomic design and lightweight construction save your stamina during extended gaming sessions, while the dead zone-free analog sticks provide precise input. This Power A controller includes a detachable 10-foot USB cable and Velcro strap for easy storage.</p>\r\n\r\n<p>Take control of your favorite adventures, solve puzzles and defeat epic bosses with the help of this gamepad for Switch</p>\r\n\r\n<p>Includes POWER A gamepad, micro-USB to USB-C cable</p>\r\n\r\n<p>Officially licensed by POWER A</p>\r\n\r\n<p>Compatible with Switch</p>', '', 0),
(16, 1, 'B\'day', '<p style=\"margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"line-height:107%\">Editorial Review</span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">History may prove Beyonc&eacute;&#39;s <i>B&#39;Day</i> to be a rare double-whammy of an achievement. Not only is it destined to hold up as one of the thumpingest, most polished-sounding discs of 2006, it&#39;s also bound to loose a new phrase into the popular lexicon: a &quot;freekum dress&quot; (n.), as described on a same-named track halfway through this excellent CD, is a &quot;right-fittin&#39;&quot; garment owned by every woman; &quot;when they act wrong, that&#39;s when you put it on.&quot; Linguistic hijinks aside, here is Beyonc&eacute; as the public rarely sees her: fully liberated and artistically fearless. &quot;Ring the Alarm,&quot; a big-banging, fire-alarm-clanging wake-up call to a cheating man, finds her seething; &quot;Kitty Kat,&quot; a feline-like size-up of a stale relationship helped along by the still innovative Neptunes, shows her spurned; the womanly, fire-in-the-belly come-on &quot;Suga Mama&quot; gets her way, way worked up; and the crackling, vocally volcanic &quot;Resentment&quot; steeps her in Aretha-caliber soul. For all the disc&#39;s solo trailblazing, though, where it really soars is on one of two duets with Jay-Z: While &quot;Up Grade U&quot; chugs along entertainingly enough about the good life (&quot;I&#39;m talkin&#39; spa bags and fly pads and rooms at the Bloomberg&quot;), opener &quot;Deja Vu&quot; blasts out a bomp-bomp beat nobody with a head to nod could resist. Cake, candles, and Cristal or no, <i>B&#39;Days</i> rarely get this good. <i>--Tammy La Gorce</i></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"line-height:107%\">Track Listings </span></b></span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Deja Vu - Beyonc&eacute;, Jay-Z, </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Get Me Bodied </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Suga Mama </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Upgrade U - Beyonc&eacute;, Jay-Z, </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Ring the Alarm </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Kitty Kat </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Freakum Dress </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Green Light </span></span></span></span></li>\r\n	<li style=\"margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Irreplaceable </span></span></span></span></li>\r\n	<li style=\"margin-bottom:11px; margin-left:8px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"line-height:107%\">Resentment</span></span></span></span></li>\r\n</ol>', '', 0);
