libri,sans-serif\"><span style=\"line-height:107%\">Fly Away</span></span></span></span></li>\r\n</ol>', '', 0),
(18, 1, 'How Bernie Sanders and the 2020 Candidates Are Approaching Trump', '<table class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; width:510px; padding:0in 7px 0in 7px; border-top:1px solid black; border-right:1px solid black; border-left:1px solid black\" valign=\"top\">\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">By Eric Lach</span></span></span></p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">During CNN&rsquo;s televised town-hall event with Senator Bernie Sanders on Monday night, a Howard University student named Osara Grayson stood up to ask the newly announced Democratic Presidential candidate a question. &ldquo;In a political climate where we see the current President and his followers using terms such as &lsquo;fake news&rsquo; or &lsquo;alternative facts,&rsquo; &rdquo; Grayson said, reading from a notecard, &ldquo;how do you plan to have a productive discussion with someone who is unwilling to accept facts?&rdquo;</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">Sanders, standing on the stage, nodded. He first addressed Trump&rsquo;s attacks on the media. &ldquo;Understand what that means,&rdquo; he said. &ldquo;This is an attack on the very fundamentals of American democracy.&rdquo; Then he turned to how he will approach the campaign. The discussion wouldn&rsquo;t be with Trump, he said, but with his supporters. &ldquo;I go not only into communities which are progressive or Democratic&mdash;we head out to Trump country,&rdquo; he said. &ldquo;And we are going to talk to those people, and we are going to expose Trump as the liar and fraud that he is. Trump told the working people that he was going to be on their side. He is not on their side.&rdquo; By the end of the campaign, Sanders said, &ldquo;I suspect that a number of people who voted for Donald Trump will understand that he is not their friend.&rdquo;</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">CNN&rsquo;s Wolf Blitzer, who served as moderator, pressed Sanders on a more specific point. If he were on a debate stage with Trump, Blitzer asked, how would Sanders &ldquo;engage&rdquo; with him? Sanders, so often deadly serious during campaign events, offered a joke: &ldquo;We&rsquo;ll bring a lie detector along, and every time he lies it goes beep.&rdquo; Then Sanders, with his usual constancy, returned to his earlier point. &ldquo;I have conservative friends, we all do,&rdquo; Sanders said. &ldquo;And they&rsquo;re honest people. They believe what they believe, I believe what I believe. And that&rsquo;s called democracy, that&rsquo;s a good thing. But I think the fraud that Trump is, the pathological liar that he is, has to be exposed.&rdquo;</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">Democrats who have put themselves forward as Presidential candidates have resisted framing the 2020 election as simply a referendum on Trump. Elizabeth Warren has described the President as &ldquo;just the latest and most extreme symptom of what has gone wrong in America.&rdquo; Cory Booker has said he is &ldquo;going to run a race about not who I&rsquo;m against or what I&rsquo;m against but who I&rsquo;m for and what I&rsquo;m for.&rdquo; Kamala Harris prefers talking about restoring &ldquo;truth&rdquo; and &ldquo;justice&rdquo; to calling Trump out by name on the stump. Sanders has his own broad progressive agenda. But on Monday, pushed to offer his plans to confront Trump, he drew a bright line between Trump and the voters who made him President. The path to a post-Trump country, Sanders said, runs through Trump country.</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
(19, 1, 'U.S. Loses Appeal Seeking to Block AT&T-Time Warner Merger', '<table class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; width:312px; padding:0in 7px 0in 7px; border-top:1px solid black; border-right:1px solid black; border-left:1px solid black\" valign=\"top\">\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">By Edmund Lee and Cecilia Kang</span></span></span></p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The merger between AT&amp;T and Time Warner has already begun to reshape much of the media industry. CreditCreditStephanie Keith/Reuters</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The federal government on Tuesday lost its second court challenge to AT&amp;T&rsquo;s $85.4 billion merger with Time Warner, a blockbuster deal that has already begun to reshape much of the media industry.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">A three-judge panel of the United States Court of Appeals for the District of Columbia rejected the government&rsquo;s claim that a lower court had applied antitrust laws incorrectly in allowing the merger to proceed. Justice Department lawyers have argued that the combination of the two companies would reduce competition and hurt consumers.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">&ldquo;The government&rsquo;s objections that the District Court misunderstood and misapplied economic principles and clearly erred in rejecting the quantitative model are unpersuasive,&rdquo; Judge Judith W. Rogers wrote on behalf of the panel.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The Justice Department, which did not immediately respond to a request for comment, could choose to appeal to the Supreme Court. But the agency is unlikely to take that step, according to a person familiar with the case, who spoke on the condition of anonymity because no final decision had been made.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">AT&amp;T can now proceed with its plan to transform WarnerMedia into a streaming-video business in its version of the television industry&rsquo;s go-to strategy. The company has said it would unveil several online video products by early next year, with the premium cable channel HBO anchoring a service that would feature films and TV shows from the Warner Bros. library. (HBO will continue to be available as a stand-alone service.)</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">That means blockbuster movies like &ldquo;Wonder Woman&rdquo; and installments of the Harry Potter franchise could show up on the service next to TV shows like &ldquo;Friends&rdquo; and HBO hits like &ldquo;Game of Thrones.&rdquo; AT&amp;T also plans to license some of its video properties to services like Netflix, a strategy that could undermine its own streaming product since audiences would be able to watch its shows and movies elsewhere.</span></span></span></p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The appeals court ruling was a blow to the Justice Department and its lead antitrust regulator, Makan Delrahim, a conservative appointed by President Trump. Mr. Delrahim had sought a divestiture of some Time Warner assets as a condition of allowing the deal to go through, but AT&amp;T&rsquo;s chief executive, Randall Stephenson, refused to make such concessions.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">In a statement, David McAtee, AT&amp;T&rsquo;s general counsel, welcomed the appeals court&rsquo;s decision, which followed a lower-court ruling last June.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">&ldquo;The merger of these innovative companies has already yielded significant consumer benefits, and it will continue to do so for years to come,&rdquo; Mr. McAtee said. &ldquo;While we respect the important role that the U.S. Department of Justice plays in the merger review process, we trust that today&rsquo;s unanimous decision from the D.C. Circuit will end this litigation.&rdquo;</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">In the case of AT&amp;T and Time Warner, which has been renamed WarnerMedia, the wireless provider is considered a content distributor and the media business a content supplier. AT&amp;T said that because the companies did not compete, the merger would yield benefits for customers like lower bills and new shows tailored for mobile devices.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The deal brought together one of the nation&rsquo;s largest wireless providers with a vast media business that includes CNN in addition to HBO and Warner Bros. AT&amp;T has over 153 million wireless subscribers and also owns the satellite TV service DirecTV.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">AT&amp;T has been operating WarnerMedia as a separate group, making it easier to unwind the business if the Justice Department prevailed in court. The group will continue to operate as a separate division, but AT&amp;T can now integrate it more deeply with the parent company. That will give AT&amp;T executives direct control over Turner Broadcasting, which the Justice Department sought to force the company to sell as a condition of the deal.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">AT&amp;T had agreed to take a hands-off approach to Turner during the appeal, but it can now make staff changes at the unit and take the lead in negotiating licensing deals with cable operators like Comcast or Charter. Turner includes CNN and the cable networks TNT and TBS, which own rights to broadcast games of major sports leagues like Major League Baseball and the National Basketball Association.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The merger attracted a significant amount of political interest. As a presidential candidate, Donald J. Trump, who has frequently criticized CNN as &ldquo;fake news,&rdquo; vowed to block the deal if he was elected &ldquo;because it&rsquo;s too much concentration of power in the hands of too few.&rdquo;</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The Justice Department has insisted that political considerations played no role in the decision to fight it.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">William P. Barr, who was confirmed as attorney general this month, was a member of the Time Warner board until June. He told senators at his confirmation hearing that he would recuse himself from the agency&rsquo;s efforts to dismantle the merger. Mr. Barr held more than $4.2 million worth of Time Warner stock at the end of March and sold his shares sometime before the end of June.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The lower court&rsquo;s approval of Time Warner&rsquo;s merger with AT&amp;T touched off an intense round of deal making. Comcast and the Walt Disney Company clashed in a fiercely contested bidding war for the bulk of 21st Century Fox, the media empire created by Rupert Murdoch.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">Disney eventually won, securing the rights to Mr. Murdoch&rsquo;s film studios, including 20th Century Fox, and several of his cable networks. Comcast, which owns NBCUniversal, separately won a bid for British satellite broadcaster Sky, which the Murdoch family had controlled. (Mr. Murdoch will continue to control Fox News and Fox broadcasting, as well as the sports network FS1 and the business network Fox Business.) CBS and Viacom, both controlled by the Redstone family, could pursue a merger this year.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The government&rsquo;s approach to the AT&amp;T-Time Warner merger contrasts sharply with its relatively quick approval of Disney&rsquo;s acquisition of 21st Century Fox&rsquo;s entertainment properties. That agreement, which called for Disney to pay $71.3 billion for Fox&rsquo;s television and movie business, was approved in June, about six months after it was announced. Transactions of such size typically take a year or more.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">After AT&amp;T closed the deal with Time Warner in June, it quickly appointed an executive to oversee the new acquisition. The move led some people to worry that the company would foist its mechanized methods onto Time Warner. But AT&amp;T has said it plans to preserve the entertainment giant&rsquo;s culture of talent and creativity.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">AT&amp;T also has to prove to its investors that it can pay off its staggering debt load of $171 billion, much more than most public companies carry. The company borrowed $40 billion to finance the Time Warner acquisition. Mr. Stephenson has said AT&amp;T should be able to pay off about $30 billion of its debt this year.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">The wireless industry continues to face substantial challenges. The nation&rsquo;s four major carriers &mdash; AT&amp;T, Verizon, T-Mobile and Sprint &mdash; have been locked in a price war for several years. Most people in the country already pay for mobile service, and the carriers have had to lower their prices to steal customers away from one another. That has reduced profits, prompting new strategies.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">AT&amp;T bought Time Warner in a bid to hold on to customers by offering added products like HBO and other video services, either at discounted rates or as part of a package.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">Verizon has taken a different tack. By investing more heavily in the next-generation cellular technology known as 5G, the company hopes to beat its rivals in offering customers faster internet speeds. The technology could eventually replace the broadband services now sold by cable providers. T-Mobile and Sprint are seeking approval for a merger that would create a bigger company able to supercharge its own investments in 5G technology.</span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 0),
