(21, 1, 'The New Yorker Magazine delivered for 1 year (47 issues)', '<table class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; width:741px; padding:0in 7px 0in 7px; border-top:1px solid black; border-right:1px solid black; border-left:1px solid black\" valign=\"top\">\r\n			<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"background:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:red\">2018 National Magazine Award Winner!</span></span></span></b><span style=\"background:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">&nbsp;The New Yorker is the eclectic magazine for readers interested in the arts, current events, and culture. Every subscription to the New Yorker includes articles on domestic and international news, exploring current ideas and trends, plus sports, fashion, and entertainment events. In addition, The New Yorker Magazine is well known for publishing outstanding short fiction and cartoons with an ironic twist. This is a print-only New Yorker magazine subscription.</span></span></span></span></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<h2><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2f5496\"><span style=\"font-weight:normal\"><b><span style=\"color:black\">Included With Your The New Yorker Magazine Subscription</span></b></span></span></span></span></span></span></h2>\r\n\r\n			<ul>\r\n				<li style=\"margin-bottom:8px\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Free Shi